    ///   - [`license_model(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::license_model) / [`set_license_model(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_license_model): <p>License model information for this DB instance.</p>  <p>Valid values: <code>license-included</code> | <code>bring-your-own-license</code> | <code>general-public-license</code> </p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable.</p>
    ///   - [`iops(i32)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::iops) / [`set_iops(Option<i32>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_iops): <p>The amount of Provisioned IOPS (input/output operations per second) to be initially allocated for the DB instance. For information about valid IOPS values, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/CHAP_Storage.html">Amazon RDS DB instance storage</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>Constraints: For MariaDB, MySQL, Oracle, and PostgreSQL DB instances, must be a multiple between .5 and 50 of the storage amount for the DB instance. For SQL Server DB instances, must be a multiple between 1 and 50 of the storage amount for the DB instance.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. Storage is managed by the DB cluster.</p>
    ///   - [`option_group_name(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::option_group_name) / [`set_option_group_name(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_option_group_name): <p>A value that indicates that the DB instance should be associated with the specified option group.</p>  <p>Permanent options, such as the TDE option for Oracle Advanced Security TDE, can't be removed from an option group. Also, that option group can't be removed from a DB instance after it is associated with a DB instance.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable.</p>
    ///   - [`character_set_name(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::character_set_name) / [`set_character_set_name(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_character_set_name): <p>For supported engines, this value indicates that the DB instance should be associated with the specified <code>CharacterSet</code>.</p>  <p>This setting doesn't apply to RDS Custom. However, if you need to change the character set, you can change it on the database itself.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. The character set is managed by the DB cluster. For more information, see <code>CreateDBCluster</code>.</p>
    ///   - [`nchar_character_set_name(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::nchar_character_set_name) / [`set_nchar_character_set_name(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_nchar_character_set_name): <p>The name of the NCHAR character set for the Oracle DB instance.</p>  <p>This parameter doesn't apply to RDS Custom.</p>
    ///   - [`publicly_accessible(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::publicly_accessible) / [`set_publicly_accessible(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_publicly_accessible): <p>A value that indicates whether the DB instance is publicly accessible.</p>  <p>When the DB instance is publicly accessible, its Domain Name System (DNS) endpoint resolves to the private IP address from within the DB instance's virtual private cloud (VPC). It resolves to the public IP address from outside of the DB instance's VPC. Access to the DB instance is ultimately controlled by the security group it uses. That public access is not permitted if the security group assigned to the DB instance doesn't permit it.</p>  <p>When the DB instance isn't publicly accessible, it is an internal DB instance with a DNS name that resolves to a private IP address.</p>  <p>Default: The default behavior varies depending on whether <code>DBSubnetGroupName</code> is specified.</p>  <p>If <code>DBSubnetGroupName</code> isn't specified, and <code>PubliclyAccessible</code> isn't specified, the following applies:</p>  <ul>   <li> <p>If the default VPC in the target Region doesn’t have an internet gateway attached to it, the DB instance is private.</p> </li>   <li> <p>If the default VPC in the target Region has an internet gateway attached to it, the DB instance is public.</p> </li>  </ul>  <p>If <code>DBSubnetGroupName</code> is specified, and <code>PubliclyAccessible</code> isn't specified, the following applies:</p>  <ul>   <li> <p>If the subnets are part of a VPC that doesn’t have an internet gateway attached to it, the DB instance is private.</p> </li>   <li> <p>If the subnets are part of a VPC that has an internet gateway attached to it, the DB instance is public.</p> </li>  </ul>
    ///   - [`tags(Vec<Tag>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::tags) / [`set_tags(Option<Vec<Tag>>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_tags): <p>Tags to assign to the DB instance.</p>
    ///   - [`db_cluster_identifier(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::db_cluster_identifier) / [`set_db_cluster_identifier(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_db_cluster_identifier): <p>The identifier of the DB cluster that the instance will belong to.</p>  <p>This setting doesn't apply to RDS Custom.</p>
    ///   - [`storage_type(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::storage_type) / [`set_storage_type(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_storage_type): <p>Specifies the storage type to be associated with the DB instance.</p>  <p>Valid values: <code>gp2 | gp3 | io1 | standard</code> </p>  <p>If you specify <code>io1</code> or <code>gp3</code>, you must also include a value for the <code>Iops</code> parameter.</p>  <p>Default: <code>io1</code> if the <code>Iops</code> parameter is specified, otherwise <code>gp2</code> </p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. Storage is managed by the DB cluster.</p>
    ///   - [`tde_credential_arn(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::tde_credential_arn) / [`set_tde_credential_arn(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_tde_credential_arn): <p>The ARN from the key store with which to associate the instance for TDE encryption.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable.</p>
