    ///   - [`storage_encrypted(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::storage_encrypted) / [`set_storage_encrypted(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_storage_encrypted): <p>A value that indicates whether the DB instance is encrypted. By default, it isn't encrypted.</p>  <p>For RDS Custom instances, either set this parameter to <code>true</code> or leave it unset. If you set this parameter to <code>false</code>, RDS reports an error.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. The encryption for DB instances is managed by the DB cluster.</p>
    ///   - [`kms_key_id(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::kms_key_id) / [`set_kms_key_id(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_kms_key_id): <p>The Amazon Web Services KMS key identifier for an encrypted DB instance.</p>  <p>The Amazon Web Services KMS key identifier is the key ARN, key ID, alias ARN, or alias name for the KMS key. To use a KMS key in a different Amazon Web Services account, specify the key ARN or alias ARN.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. The Amazon Web Services KMS key identifier is managed by the DB cluster. For more information, see <code>CreateDBCluster</code>.</p>  <p>If <code>StorageEncrypted</code> is enabled, and you do not specify a value for the <code>KmsKeyId</code> parameter, then Amazon RDS uses your default KMS key. There is a default KMS key for your Amazon Web Services account. Your Amazon Web Services account has a different default KMS key for each Amazon Web Services Region.</p>  <p> <b>Amazon RDS Custom</b> </p>  <p>A KMS key is required for RDS Custom instances. For most RDS engines, if you leave this parameter empty while enabling <code>StorageEncrypted</code>, the engine uses the default KMS key. However, RDS Custom doesn't use the default key when this parameter is empty. You must explicitly specify a key.</p>
    ///   - [`domain(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::domain) / [`set_domain(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_domain): <p>The Active Directory directory ID to create the DB instance in. Currently, only MySQL, Microsoft SQL Server, Oracle, and PostgreSQL DB instances can be created in an Active Directory Domain.</p>  <p>For more information, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/kerberos-authentication.html"> Kerberos Authentication</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. The domain is managed by the DB cluster.</p>
    ///   - [`copy_tags_to_snapshot(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::copy_tags_to_snapshot) / [`set_copy_tags_to_snapshot(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_copy_tags_to_snapshot): <p>A value that indicates whether to copy tags from the DB instance to snapshots of the DB instance. By default, tags are not copied.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. Copying tags to snapshots is managed by the DB cluster. Setting this value for an Aurora DB instance has no effect on the DB cluster setting.</p>
    ///   - [`monitoring_interval(i32)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::monitoring_interval) / [`set_monitoring_interval(Option<i32>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_monitoring_interval): <p>The interval, in seconds, between points when Enhanced Monitoring metrics are collected for the DB instance. To disable collection of Enhanced Monitoring metrics, specify 0. The default is 0.</p>  <p>If <code>MonitoringRoleArn</code> is specified, then you must set <code>MonitoringInterval</code> to a value other than 0.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p>Valid Values: <code>0, 1, 5, 10, 15, 30, 60</code> </p>
    ///   - [`monitoring_role_arn(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::monitoring_role_arn) / [`set_monitoring_role_arn(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_monitoring_role_arn): <p>The ARN for the IAM role that permits RDS to send enhanced monitoring metrics to Amazon CloudWatch Logs. For example, <code>arn:aws:iam:123456789012:role/emaccess</code>. For information on creating a monitoring role, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_Monitoring.OS.html#USER_Monitoring.OS.Enabling">Setting Up and Enabling Enhanced Monitoring</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>If <code>MonitoringInterval</code> is set to a value other than 0, then you must supply a <code>MonitoringRoleArn</code> value.</p>  <p>This setting doesn't apply to RDS Custom.</p>
    ///   - [`domain_iam_role_name(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::domain_iam_role_name) / [`set_domain_iam_role_name(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_domain_iam_role_name): <p>Specify the name of the IAM role to be used when making API calls to the Directory Service.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. The domain is managed by the DB cluster.</p>
    ///   - [`promotion_tier(i32)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::promotion_tier) / [`set_promotion_tier(Option<i32>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_promotion_tier): <p>A value that specifies the order in which an Aurora Replica is promoted to the primary instance after a failure of the existing primary instance. For more information, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/AuroraUserGuide/Aurora.Managing.Backups.html#Aurora.Managing.FaultTolerance"> Fault Tolerance for an Aurora DB Cluster</a> in the <i>Amazon Aurora User Guide</i>.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p>Default: 1</p>  <p>Valid Values: 0 - 15</p>
    ///   - [`timezone(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::timezone) / [`set_timezone(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_timezone): <p>The time zone of the DB instance. The time zone parameter is currently supported only by <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/CHAP_SQLServer.html#SQLServer.Concepts.General.TimeZone">Microsoft SQL Server</a>.</p>
    ///   - [`enable_iam_database_authentication(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::enable_iam_database_authentication) / [`set_enable_iam_database_authentication(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_enable_iam_database_authentication): <p>A value that indicates whether to enable mapping of Amazon Web Services Identity and Access Management (IAM) accounts to database accounts. By default, mapping isn't enabled.</p>  <p>For more information, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/UsingWithRDS.IAMDBAuth.html"> IAM Database Authentication for MySQL and PostgreSQL</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. Mapping Amazon Web Services IAM accounts to database accounts is managed by the DB cluster.</p>
    ///   - [`enable_performance_insights(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::enable_performance_insights) / [`set_enable_performance_insights(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_enable_performance_insights): <p>A value that indicates whether to enable Performance Insights for the DB instance. For more information, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_PerfInsights.html">Using Amazon Performance Insights</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>This setting doesn't apply to RDS Custom.</p>
    ///   - [`performance_insights_kms_key_id(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::performance_insights_kms_key_id) / [`set_performance_insights_kms_key_id(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_performance_insights_kms_key_id): <p>The Amazon Web Services KMS key identifier for encryption of Performance Insights data.</p>  <p>The Amazon Web Services KMS key identifier is the key ARN, key ID, alias ARN, or alias name for the KMS key.</p>  <p>If you do not specify a value for <code>PerformanceInsightsKMSKeyId</code>, then Amazon RDS uses your default KMS key. There is a default KMS key for your Amazon Web Services account. Your Amazon Web Services account has a different default KMS key for each Amazon Web Services Region.</p>  <p>This setting doesn't apply to RDS Custom.</p>
    ///   - [`performance_insights_retention_period(i32)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::performance_insights_retention_period) / [`set_performance_insights_retention_period(Option<i32>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_performance_insights_retention_period): <p>The number of days to retain Performance Insights data. The default is 7 days. The following values are valid:</p>  <ul>   <li> <p>7</p> </li>   <li> <p> <i>month</i> * 31, where <i>month</i> is a number of months from 1-23</p> </li>   <li> <p>731</p> </li>  </ul>  <p>For example, the following values are valid:</p>  <ul>   <li> <p>93 (3 months * 31)</p> </li>   <li> <p>341 (11 months * 31)</p> </li>   <li> <p>589 (19 months * 31)</p> </li>   <li> <p>731</p> </li>  </ul>  <p>If you specify a retention period such as 94, which isn't a valid value, RDS issues an error.</p>  <p>This setting doesn't apply to RDS Custom.</p>
    ///   - [`enable_cloudwatch_logs_exports(Vec<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::enable_cloudwatch_logs_exports) / [`set_enable_cloudwatch_logs_exports(Option<Vec<String>>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_enable_cloudwatch_logs_exports): <p>The list of log types that need to be enabled for exporting to CloudWatch Logs. The values in the list depend on the DB engine. For more information, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_LogAccess.html#USER_LogAccess.Procedural.UploadtoCloudWatch"> Publishing Database Logs to Amazon CloudWatch Logs</a> in the <i>Amazon RDS User Guide</i>.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. CloudWatch Logs exports are managed by the DB cluster.</p>  <p> <b>RDS Custom</b> </p>  <p>Not applicable.</p>  <p> <b>MariaDB</b> </p>  <p>Possible values are <code>audit</code>, <code>error</code>, <code>general</code>, and <code>slowquery</code>.</p>  <p> <b>Microsoft SQL Server</b> </p>  <p>Possible values are <code>agent</code> and <code>error</code>.</p>  <p> <b>MySQL</b> </p>  <p>Possible values are <code>audit</code>, <code>error</code>, <code>general</code>, and <code>slowquery</code>.</p>  <p> <b>Oracle</b> </p>  <p>Possible values are <code>alert</code>, <code>audit</code>, <code>listener</code>, <code>trace</code>, and <code>oemagent</code>.</p>  <p> <b>PostgreSQL</b> </p>  <p>Possible values are <code>postgresql</code> and <code>upgrade</code>.</p>
    ///   - [`processor_features(Vec<ProcessorFeature>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::processor_features) / [`set_processor_features(Option<Vec<ProcessorFeature>>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_processor_features): <p>The number of CPU cores and the number of threads per core for the DB instance class of the DB instance.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable.</p>
    ///   - [`deletion_protection(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::deletion_protection) / [`set_deletion_protection(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_deletion_protection): <p>A value that indicates whether the DB instance has deletion protection enabled. The database can't be deleted when deletion protection is enabled. By default, deletion protection isn't enabled. For more information, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_DeleteInstance.html"> Deleting a DB Instance</a>.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. You can enable or disable deletion protection for the DB cluster. For more information, see <code>CreateDBCluster</code>. DB instances in a DB cluster can be deleted even when deletion protection is enabled for the DB cluster.</p>
    ///   - [`max_allocated_storage(i32)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::max_allocated_storage) / [`set_max_allocated_storage(Option<i32>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_max_allocated_storage): <p>The upper limit in gibibytes (GiB) to which Amazon RDS can automatically scale the storage of the DB instance.</p>  <p>For more information about this setting, including limitations that apply to it, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_PIOPS.StorageTypes.html#USER_PIOPS.Autoscaling"> Managing capacity automatically with Amazon RDS storage autoscaling</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>This setting doesn't apply to RDS Custom.</p>  <p> <b>Amazon Aurora</b> </p>  <p>Not applicable. Storage is managed by the DB cluster.</p>
    ///   - [`enable_customer_owned_ip(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::enable_customer_owned_ip) / [`set_enable_customer_owned_ip(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_enable_customer_owned_ip): <p>A value that indicates whether to enable a customer-owned IP address (CoIP) for an RDS on Outposts DB instance.</p>  <p>A <i>CoIP</i> provides local or external connectivity to resources in your Outpost subnets through your on-premises network. For some use cases, a CoIP can provide lower latency for connections to the DB instance from outside of its virtual private cloud (VPC) on your local network.</p>  <p>For more information about RDS on Outposts, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/rds-on-outposts.html">Working with Amazon RDS on Amazon Web Services Outposts</a> in the <i>Amazon RDS User Guide</i>.</p>  <p>For more information about CoIPs, see <a href="https://docs.aws.amazon.com/outposts/latest/userguide/routing.html#ip-addressing">Customer-owned IP addresses</a> in the <i>Amazon Web Services Outposts User Guide</i>.</p>
